Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
   if(_parent.方向 == "右")
   {
      _parent.移动("右",慢速度);
   }
   else if(_parent.方向 == "左")
   {
      _parent.移动("左",慢速度);
   }
}
gotoAndPlay("a" + random(3));

function 消弹()
{
	var 消弹属性 = _root.消弹属性初始化(this.攻击点A);
	消弹属性.消弹方向 = _parent.方向 == "右" ? "左" : "右";
	消弹属性.Z轴攻击范围 = 30;
	消弹属性.区域定位area = this.攻击点A;

	_root.消除子弹(消弹属性);
}

function 反向消弹()
{
	var 消弹属性 = _root.消弹属性初始化(this.攻击点A);
	消弹属性.消弹方向 = _parent.方向;
	消弹属性.Z轴攻击范围 = 30;
	消弹属性.区域定位area = this.攻击点A;

	_root.消除子弹(消弹属性);
}

onClipEvent(load){
   声音 = "";
   霰弹值 = 1;
   子弹散射度 = 0;
   发射效果 = "";
   子弹种类 = "近战子弹";
   子弹威力 = _parent._parent.空手攻击力;
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 30;
   击倒率 = 100;
   击中后子弹的效果 = "空手攻击火花";
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
}

